#include <boost/functional/hash.hpp>
#include <iostream>

using CsvString            = std::string; // std::vector<char>;
using CsvRecordInformation = std::vector<CsvString>;
using CsvFileInformation = std::vector<CsvRecordInformation>;

template <typename P> int bench(P&& parser) {
    CsvFileInformation result;

    int ok_parses=0;
    for (auto const& testdata : ::testdata) {
        auto start = testdata.begin(), end = testdata.end();
        bool ok_parse=(parse(start, end, parser, result) && start == end);
        ok_parses += int(ok_parse);
    }
  #ifdef HASH_CHECK
    size_t cksum = 42;
    boost::hash_combine(cksum, boost::hash_range(result.begin(), result.end()));
    //std::cout << "Hash: " << cksum << "\n";

    //for (auto& row : result) { for (auto& cel : row) std::cout << cel << ";"; std::cout << "\n"; }
    assert(sanity_checksum == cksum);
  #endif
    return ok_parses;
}

